import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div id="juego">
  <div class="carton cartonJugador">
    <div class="etiqueta">Player</div>
  </div>
  <div id="bingo">
    <div id="bola"></div>
    <button onClick="sacarBola();">SACAR BOLA</button>
  </div>
  <div class="carton cartonCpu">
    <div class="etiqueta">CPU</div></div>
</div>
  );
}

export default App;
